    }
    fetch("http://localhost:9000/prodact")
    .then(res=>res.json())
    .then()
return(
    <div>
<h1>Updata the prodact</h1>
<form onSubmit={FormSubmit}>
<div className="mb-3">
<label htmlFor="exampleInputEmail1" className="form-label">Title </label>
<input  type="text" placeholder="Prodact Title" className="form-control" id="exampleInputEmail1" aria-describedby="prodact Title" />
</div> 
<div className="mb-3">
<label htmlFor="exampleInputEmail1" className="form-label">Price </label>
<input type="text" placeholder="Prodact Price" className="form-control" id="exampleInputEmail1" aria-describedby="prodact Title" />
</div> 
<button type="submit" className="btn btn-primary">Add</button>
</form>
  </div>
)
}
export default Edit
